import * as React from 'react';

const SkipPrevious = ((props: any) => {
    const [size, setSize] = React.useState(props.size ? props.size : 250);

    return (
        <div        >
            <svg
                xmlns="http://www.w3.org/2000/svg"
                width={size}
                height={size}
                fill="currentColor"
                viewBox="0 0 16 16">

                {/* <circle cx="8" cy="8" r="7" stroke='#000' fill='rgba(255,255,255,0)' /> */}
                <line x1='4' y1='7' x2='4' y2='9' stroke='#000' stroke-width='2' />
                <polygon points="4, 8 7, 6 7, 10" stroke='#000' fill="#000" />
                <path d='M 4,8 A 8 8 0 0 0 ' />
            </svg>
        </div>)
})

export default SkipPrevious
